import React from "react";

const VideoItem = (props) => (
  <li>
    <img src={props.video.POSTER} alt="poster" />
    <div>
        <p>{props.video.TITLE_KR}</p>
        <p>{props.video.GENRE}</p>
    </div>
  </li>
);

export default VideoItem;
